import Precart from './Precart/Precart';
import ProductsCart from './ProductsCart/ProductsCart';

export default function Cart() {
  return (
    <div>
    <h1>Shopping cart</h1>
    <div style={{display: 'flex'}}>
      <Precart />
      <ProductsCart />
    </div>
  </div>
  )
}
